import React from 'react';
import ReactDOM from 'react-dom';

import './index.css';
import {App} from './Components/App';

import {GithubContext, GithubProvider} from "./Context/userContext";

ReactDOM.render(
  <GithubContext>
    <App />
  </GithubContext>,
  document.getElementById('root')
);
